async function getLogisticsCompany($axios, query, vo = {
  parkId: 1,
  defaultSort: 1
}) {
  let list,
      parm1 = {
    currentPage: 1,
    pageSize: 100,
    vo
  };
  await $axios.post('/aflc-portal/portalt/aflclogisticspark/v1/Gateway/getLogisticsCompany/' + query.id, parm1).then(res => {
    res.data.data.list.forEach(item => {
      if (JSON.parse(item.productService).length > 0) {
        item.productService1 = `
        ${JSON.parse(item.productService)[0]}
        ${JSON.parse(item.productService)[1]}
        ${JSON.parse(item.productService)[2]}`;
      }

      if (JSON.parse(item.otherService).length > 0) {
        item.otherService1 = `
        ${JSON.parse(item.otherService)[0]}
        ${JSON.parse(item.otherService)[1]}
        ${JSON.parse(item.otherService)[2]}`;
      }

      setCredit(item);
    });

    if (res.data.status === 200) {
      list = res.data.data.list;
    }
  });
  return list;
}

async function getTransportRange($axios, query, vo = {}) {
  let list,
      parm1 = {
    currentPage: 1,
    pageSize: 100,
    vo
  };
  await $axios.post('/aflc-portal/portalt/aflclogisticspark/v1/Gateway/getTransportRange/' + query.id, parm1).then(res => {
    res.data.data.list.forEach(item => {
      item.transportAgingUnit = item.transportAgingUnit.replace('多', '');
    });

    if (res.data.status === 200) {
      list = res.data.data.list;
    }
  });
  return list;
}

